package whilee;
import java.util.*;
public class simple {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
        int n,f1=1,i=1;
        Scanner sc=new Scanner (System.in);
        System.out.println("enter value");
        n=sc.nextInt();
        while(i<=n)
        {
        	f1=n*i;
        	System.out.println(""+f1);
        	i++;
        	
        }
	
	
	
	}

}
